import React from 'react';
import NavBar from 'parts/navbar/NavBar';
import HeaderBar from 'parts/header-bar/HeaderBar';
import './dashboard.css';

const Dashboard = () => (
  <div id="dashboard">
    <HeaderBar />
    <NavBar />
    <div>
      Dashboard
    </div>
  </div>
);

export default Dashboard;
